import { useSelector } from "react-redux";
import BuildCard from "./build_card";
import Mybuild from "./mybuild";
function BuildList() {
  const posts = useSelector((state) => state.postReducer.posts);
  return (
    <div>
      {posts.map((el) => (
        <BuildCard el={el} />
      ))}
    </div>
  );
}
export default BuildList;
